import styled from 'styled-components';

const Square = styled.div`
  width: 30px;
  height: 30px;
  background-color: black;
  border-width: thin;
`

export default () => {
  const [activeShape, setActiveShape] = useState(<Square/>)
  return(
    <>
     {activeShape}
    </>
  )
}
